import React from 'react';

import Head from 'next/head';

export const siteTitle = 'Next_Google';

export default function Layout({ children, home }) {
  return (
    <div>
      <Head>
        <title>{siteTitle}</title>
      </Head>
      
      {children}
    </div>
  )
}
